import React from 'react'
import Carousel from 'react-bootstrap/Carousel';
import { sliderData } from '../../data/resumeData';

const MySlider = ({children}) => {
  return (
    <Carousel>
        <Carousel.Item>
        <img
          className="d-block w-100"
          src= {sliderData[0].img}
          alt={sliderData[0].title}
        />
        <Carousel.Caption>
          <h3>{sliderData[0].title}</h3>
          <p>{sliderData[0].description}</p>
        </Carousel.Caption>
      </Carousel.Item>
      {children.map((item) => (
          <SliderItem img={item.img} title={item.title} description={item.description}/>
        ))}
    </Carousel>
  )
}

export const SliderItem = ({img, title, description}) => (
    <Carousel.Item>
        <img
          className="d-block w-100"
          src={img}
          alt={title}
        />
        <Carousel.Caption>
          <h3>{title}</h3>
          <p>{description}</p>
        </Carousel.Caption>
      </Carousel.Item>
)

export default MySlider
